import React from 'react';
import './App.css';
import Form from './form';

onSubmit = (fields) => {
  console.log("App component received: ", fields)
}

function App() {
  return (
    <div className="App">
      <Form onSubmit={fields=> this.onSubmit(fields)}/>
    </div>
  );
}

export default App;
